import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import logo from '../images/logo.png';
import '../css/KM.css'
import Card from 'react-bootstrap/Card';

const info = [
    {
        titel: "Klubbmästare",
        namn: "Oliver Jensen",
        img: null
    },
    {
        titel: "Vice Klubbmästare",
        namn: "Johan Widmark",
        img: null
    },
    {
        titel: "Pubmästare",
        namn: "Adam Henriksson",
        img: null
    },
    {
        titel: "Marsall",
        namn: "",
        img: null
    },
    {
        titel: "Marsall",
        namn: "",
        img: null
    }
];



const KM = React.memo(() => {


    info.forEach((person, i) => {

    });

    return(
        <Container className="wide">
            <Row key={"row"+i}>
                <Col sm key={"col_"+i}>
                    <Card bg="dark">
                        <Card.Header>{ person.title }</Card.Header>
                        <Card.Body>
                            <Card.Img src={logo}/>
                            <Card.Title>{ person.name }</Card.Title>
                        </Card.Body>
                    </Card>
                </Col>
            </Row>
        </Container>
    )
});


export default KM;
